import React from 'react';
// import images from '../images/';

const Project_box= props =>(<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">
<div class="card shadow_box" >
    <div class="card-body ">
<small class="float-right" style={{color: 'darkgray'}}>TeamSize: {props.project.teamSize}</small>
        <h1 class="bold text-center card-title">{props.project.title} </h1>
        <p class="card-text">{props.project.description}</p>

        {/* <button class="btn-primary ">Read more</button> */}

    </div>
</div>
</div>



);

class Skill extends React.Component{
    constructor(props){
    super(props)
        this.state={

              languages:["Python","Java","JavaScript","C","C++","html","Dart","Latex"],
              databases:['mySql','oracle','firebase','mongodb'],
              frameWorks:['react.js','express.js','flutter','Bootstrap'],
              os:['windows','linux']
        }
    }
    languages_list(){
    const listItems = this.state.languages.map((number) =>
    <li >      {number}
    </li>
    );
    return (
       <ul>{listItems}</ul>
       );
    }

    db_list(){
        const listItems = this.state.databases.map((number) =>
        <li >      {number}
        </li>
        );
        return (
           <ul>{listItems}</ul>
           );
        }

        framework_list(){
            const listItems = this.state.frameWorks.map((number) =>
            <li >      {number}
            </li>
            );
            return (
               <ul>{listItems}</ul>
               );
            }
    render(){
        return(
            <div className="container project_bg">
                <hr />
                <h1 className="text-center"> Skills</h1>
                <div className="container">
                    <div className="row">
                        <div className="col-xs-12 col-sm-6 col-md-4 col-lg-4">
                           <h1 className="bold">Languages</h1>

                           <h2 className="lead grey_color">{this.languages_list()}</h2>

                        </div>
                        <div className="col-xs-12 col-sm-6 col-md-4 col-lg-4">
                           <h1 className="bold">DataBases</h1>

                           <h2 className="lead grey_color">{this.db_list()}</h2>

                        </div>
                        <div className="col-xs-12 col-sm-6 col-md-4 col-lg-4">
                           <h1 className="bold">FrameWor</h1>

                           <h2 className="lead grey_color">{this.framework_list()}</h2>

                        </div>
                    </div>
               </div>
                <br />
            </div>
        );
    }
}

export default Skill;
